import GoogleMapReact from 'google-map-react';

const google = window.google;

class MapBase extends Component {
    constructor() {
        super();
        this.state = {
            center: {lat: 48.852024, lng: 2.28666},
            zoom: 10
        }
    };
    render() {
        return (
            <GoogleMapReact width="400px" height="40%">
            </GoogleMapReact>
        );
    }

